    [],nt"revision_timestamp": "2016-05-25T00:52:48.708907",nt"name": "integrated-termiinal-weather-system-itws",nt"isopen":
    true,nt"url": null,nt"notes": "The ITWS is an air traffic management (ATM)
    tool that provides terminal air traffic managers and controllers plus airline dispatchers
    with highly accurate, easily understood and immediately useable graphical weather
    information and hazard alerts on a single, integrated color display.  The ITWS uses
    highly sophisticated meteorological algorithms to integrate and analyze data from
    multiple FAA and National Weather Service (NWS) sources, including data from the
    Terminal Doppler Weather Radar (TDWR), Airport Surveillance Radar Model 9 (ASR-9)
    weather channel, the Next Generation Weather Radar (NEXRAD) or WSR-88, the Low-Level
    Windshear Alert System (LLWAS), Automated Weather Observing System (AWOS) Data Acquisition
    System (ADAS), aircraft observations from Meteorological Data Collection and Reporting
    System (MDCRS), and NWS gridded model data to display current and near-term forecasts
    of weather conditions and hazards in the terminal area.",nt"license_title":
